            // this_.add.image(256-80, 230-80, level.kuang.key).setScale(level.kuang.scale, level.kuang.scale).setDepth(1)
            // this_.add.image(256+80, 230-80, level.kuang.key).setScale(level.kuang.scale, level.kuang.scale).setDepth(1)
            // this_.add.image(256, 230, level.kuang.key).setScale(level.kuang.scale, level.kuang.scale).setDepth(1)
            // this_.add.image(256, 230+80, level.kuang.key).setScale(level.kuang.scale, level.kuang.scale).setDepth(1)
            
